@import "src/values.scss";
div.banner {
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  height: 100%;
  width: 100%;
  background-image: url("/assets/images/compass_background.jpg");
  background-size: cover;
  background-position: center;
  margin: 0;
  padding: 0;
}

div.product-summary {
  width: 50%;
  height: 50%;
  background-color: $alice-blue;
  border-radius: 10px;
  box-shadow: rgba(0, 0, 0, 0.47) 3px 3px 15px 3px;
}

// Medium devices (tablets, 768px and up)
@media (max-width: 768px) {
  div.banner {
    background-position: right;
  }

  div.product-summary {
    margin-left: 0;
    width: 75%;
  }
}

// Small devices (landscape phones, 576px and up)
@media (max-width: 576px) {
  div.product-summary {
    width: 90%;
  }
}

.button {
  display: inline-block;
  cursor: pointer;
  padding: 0.75rem 1.25rem;
  border-radius: 10rem;
  color: #fff;
  text-transform: uppercase;
  font-size: 1rem;
  letter-spacing: 0.15rem;
  transition: all 0.3s;
  position: relative;
  overflow: hidden;
  z-index: 1;
  box-shadow: rgba(0, 0, 0, 0.5) 5px 2.5px 10px 0px;
  &:after {
    content: "";
    position: absolute;
    bottom: 0;
    left: 0;
    width: 100%;
    height: 100%;
    background-color: $secondary-color;
    border-radius: 10rem;
    z-index: -2;
  }
  &:before {
    content: "";
    position: absolute;
    bottom: 0;
    left: 0;
    width: 0%;
    height: 100%;
    background-color: $secondary-color-dark;
    transition: all 0.3s;
    border-radius: 10rem;
    z-index: -1;
  }
  &:hover {
    color: #fff;
    &:before {
      width: 100%;
    }
  }
}

